tables.table_schema:
CREATE TABLE Financial_Reports (
  report_id INT PRIMARY KEY,
  participant_id INT,
  report_date DATE,
  compliance_status VARCHAR(50)
);

CREATE TABLE regulatory_reports (
    report_id INT PRIMARY KEY,
    participant_id INT,
    report_date DATE,
    compliance_status BOOLEAN
);

CREATE TABLE participants (
    participant_id INT PRIMARY KEY,
    participant_name VARCHAR(50),
    participant_type VARCHAR(50),
    registration_date DATE
);

CREATE TABLE regulatory_compliance_reports (
  report_id INT PRIMARY KEY,
  participant_id INT NOT NULL,
  report_date DATE NOT NULL,
  compliance_status VARCHAR(50) NOT NULL
);

CREATE TABLE financial_market_participants (
  participant_id INT PRIMARY KEY,
  participant_name VARCHAR(100) NOT NULL,
  registration_date DATE NOT NULL,
  industry_sector VARCHAR(50) NOT NULL
);

CREATE TABLE client_accounts (
   account_id UUID PRIMARY KEY,
   client_name VARCHAR(255) NOT NULL,
   account_balance DECIMAL NOT NULL
);

CREATE TABLE regulatory_issues (
   issue_id UUID PRIMARY KEY,
   issue_description TEXT NOT NULL,
   date_reported DATE NOT NULL
);

CREATE TABLE compliance_reports (
   report_id UUID PRIMARY KEY,
   report_name VARCHAR(100) NOT NULL,
   report_date DATE NOT NULL,
   compliance_status BOOLEAN NOT NULL
);

CREATE TABLE report_transactions (
  id INT PRIMARY KEY,
  transaction_date DATE,
  amount DECIMAL,
  participant_id INT
);

CREATE TABLE participant (
  id INT PRIMARY KEY,
  name VARCHAR(50),
  location VARCHAR(100)
);

CREATE TABLE regulatory_agencies (
  id INT PRIMARY KEY,
  name VARCHAR(50),
  jurisdiction VARCHAR(100)
);

CREATE TABLE audit_logs (
  id INT PRIMARY KEY,
  log_date DATETIME,
  log_message TEXT
);
